import React, { useState } from 'react';

function Footer() {
  return (
    <footer>
      <p>&copy; 2024 My Cyworld Portfolio</p>
      <ul>
        <li>Instagram</li>
        <li>LinkedIn</li>
        <li>GitHub</li>
      </ul>
    </footer>
  );
}

export default Footer;
